css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://www.cnn.com/") {

 body div .ad, body div#skinImgDiv, body .user-msg, ad.ad--epic, iframe {
    display:none;
    opacity:0;
    visibility: hidden;
    background:none;
    background-color:transparent;
}

#skinImgDiv {
  width: 0px;
  height: 0px; 
  position: none;
  display:none;
  opacity:0;
  visibility: hidden;
  background:none;
  background-color:transparent;
}
}
